import axios from "axios";

class History extends React.Component{
    constructor(props){
        super(props)
        this.setState({
            order:[]
        })
        this.getOrders()
    }

    getOrders(){
        axios
        .get("/api/order").then((response) => {
          this.setState({ order: response.data })
          console.log(this)
      });
    }

    render(){
        return (
            <div><p>Hi!</p></div>
        )
    }
}

export default History;
